import Layout from '../components/MyLayout';

const Index = props => (
    <Layout>
        <h1>Pemrograman Web</h1>
        <p>Berdasarkan struktur katanya, maka pemrograman web terdiri dari dua kata, yaitu pemrograman yang artinya adalah 
            sekumpulan perintah yang diciptakan oleh manusia agar bisa membantu manusia lainnya untuk menghasilkan program. 
            Sementara itu web diartikan sebagai sumber informasi yang dapat diakses hanya dengan menggunakan jaringan komputer 
            yang terhubung dengan internet. Bentuk informasi yang berasal dari web itu bermacam-macam, mulai dari teks, gambar, audio, video hingga animasi. 
            Jadi, bisa disimpulkan bahwa pemrograman web adalah instruksi untuk dapat menghasilkan program atau situs web yang bisa ditampilkan dengan menggunakan browser melalui jaringan internet.</p>
    </Layout>
);

export default Index;
